Florida Department of Health (DOH)
July 22 at 2:35 AM ¬∑

@HealthyFla urges all Floridians to answer calls from (833) 917-2880 as this is part of Florida's comprehensive contact tracing effort. If you receive a phone call from this number, it's important that you speak with a contact tracer regarding potential #COVID19 exposure.
